import { useEffect } from "react";
const fetchData = () => {
  const fetchMyAPI = () => {
    fetch("http://127.0.0.1:5000/").then((response) => {
      console.log(response.json);
      return response.json;
    });
  };

  useEffect(() => {
    fetchMyAPI();
  }, []);
};

export default fetchData;
